import React,{FC} from 'react';


export enum CardVariant{
    outline = 'outline',
    primary = 'primary'
}

interface CardProps {
    width: string;
    height: string;
    children?: React.ReactNode;
    variant: CardVariant
}

export const Card:FC<CardProps> =({width, height, children, variant})=>{
    return(
        <div style={{width, height, border: variant}}>
            {children}
        </div>
    )
}
